import React from 'react';

const AccountDetails = ({ showAccountDetails, setShowAccountDetails }) => {
  return (
    <div
      className='modal'
      tabIndex='-1'
      role='dialog'
      style={{
        display: showAccountDetails ? 'block' : 'none',
        color: 'black',
      }}
    >
      <div className='modal-dialog' role='document'>
        <div className='modal-content glassmorphism2'>
          <div
            type='button'
            className='close guest-modal'
            onClick={() => setShowAccountDetails(false)}
          >
            <span aria-hidden='true'>&times;</span>
          </div>

          <div className='modal-body'>
            <div
              style={{
                color: 'white',
                display: 'flex',
                flexDirection: 'column',
              }}
            >
              <div
                style={{
                  textAlign: 'center',
                  marginBottom: '10px',
                  fontWeight: 700,
                  fontSize: 24,
                }}
              >
                Cash Gift
              </div>

              <span
                style={{
                  fontSize: 20,
                  color: '#d59a57',
                }}
              >
                <span
                  style={{
                    color: 'white',
                    fontSize: '16px',
                    marginRight: '10px',
                    marginBottom: '10px',
                  }}
                >
                  Bank:
                </span>{' '}
                Wema Bank
              </span>
              <span
                style={{
                  fontSize: 20,
                  color: '#d59a57',
                }}
              >
                <span
                  style={{
                    color: 'white',
                    fontSize: '16px',
                    marginRight: '10px',
                    marginBottom: '10px',
                  }}
                >
                  Name:
                </span>{' '}
                Adewale AkinlagunÂ 
              </span>
              <span
                style={{
                  fontSize: 20,
                  color: '#d59a57',
                }}
              >
                <span
                  style={{
                    color: 'white',
                    fontSize: '16px',
                    marginRight: '10px',
                    marginBottom: '10px',
                  }}
                >
                  Account Number:
                </span>{' '}
                0233584142
              </span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AccountDetails;
